import PropTypes from 'prop-types';
import React from "react";
import { Link } from "react-router-dom";
import {Nav, NavDropdown, Navbar} from "react-bootstrap";

function HeaderNavbar() {
  return (
    <Navbar id="navbar-bg" collapseOnSelect expand="lg" variant="dark">
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link><Link to="/" > Startseite </Link></Nav.Link>
          <NavDropdown title="Leistungen" id="collasible-nav-dropdown">
            <NavDropdown.Item><Link to="/leistung1" > Leistung1 </Link></NavDropdown.Item>
            <NavDropdown.Item><Link to="/leistung2" > Leistung2 </Link></NavDropdown.Item>
            <NavDropdown.Item><Link to="/leistung3" > Leistung3 </Link></NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
          </NavDropdown>
          <Nav.Link> <Link to="/aboutMe"> Ãœber mich </Link> </Nav.Link>
          <Nav.Link> <Link to="/contact"> Kontakt </Link> </Nav.Link>
        </Nav>
        <Nav>
          <Nav.Link href="#deets">More deets</Nav.Link>
          <Nav.Link eventKey={2} href="#memes">
            Dank memes
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default HeaderNavbar;
